import React from 'react'

export const InputName = ({name, ref, changeName}) => {
  return (
    <form>
        <label htmlFor='name'></label>
        <input type='text' name='name' ref={ref}></input>
        <button onSubmit={changeName}>Submit</button>
    </form>
  )
}
